import React, { Component } from 'react';
import { Row, Col } from 'react-bootstrap';
import './About.css'

class About extends Component {
    render(){
        return(
            <Row>
                <Col className="col" xs="6" sm="6" md="9" lg="9" style={{height: '500px'}}>
                    <h2>About Me</h2>
                </Col>
                <Col className="col" xs="6" sm="6" md="3" lg="3" style={{height: '500px'}}>
                    <img width={275} height={500} alt="placeholder" src="https://via.placeholder.com/275x500.png" />
                </Col>
            </Row>
        )
    }
}
export default About
